import{_ as a,c as e,o,a4 as t}from"./chunks/framework.CeWJkJk4.js";const n="/docs/assets/pa.DSXlReCx.png",_=JSON.parse('{"title":"常见问题参考","description":"","frontmatter":{},"headers":[],"relativePath":"user/prob.md","filePath":"user/prob.md"}'),r={name:"user/prob.md"},s=t('<h1 id="常见问题参考" tabindex="-1">常见问题参考 <a class="header-anchor" href="#常见问题参考" aria-label="Permalink to &quot;常见问题参考&quot;">​</a></h1><h2 id="ll3-能用吗" tabindex="-1">LL3 能用吗 <a class="header-anchor" href="#ll3-能用吗" aria-label="Permalink to &quot;LL3 能用吗&quot;">​</a></h2><p>可以，使用 LSE 兼容层配置为 index.js 作为启动，然后使用 nodejs 模式。</p><h2 id="为什么出现报错-typeerror-msg-map-is-not-a-function" tabindex="-1">为什么出现报错：“TypeError: msg.map is not a function”？ <a class="header-anchor" href="#为什么出现报错-typeerror-msg-map-is-not-a-function" aria-label="Permalink to &quot;为什么出现报错：“TypeError: msg.map is not a function”？&quot;">​</a></h2><p>如果你使用的机器人实现使用 string 格式，请不要关闭 base 配置中的 OnebotV11，将其保持打开</p><h2 id="为什么部分插件无法加载-显示-syntaxerror-unexpected-token-□-in-json-at-position-0" tabindex="-1">为什么部分插件无法加载，显示 “SyntaxError: Unexpected token \uFEFF□ in JSON at position 0”？ <a class="header-anchor" href="#为什么部分插件无法加载-显示-syntaxerror-unexpected-token-□-in-json-at-position-0" aria-label="Permalink to &quot;为什么部分插件无法加载，显示 “SyntaxError: Unexpected token \uFEFF□ in JSON at position 0”？&quot;">​</a></h2><p>因为编码错误导致的。请检查所有插件的 config 文件格式是否为 UTF-8（UTF8 BOM 也不行）</p><h2 id="为什么部分插件无法加载-显示如下类似报错" tabindex="-1">为什么部分插件无法加载，显示如下类似报错？ <a class="header-anchor" href="#为什么部分插件无法加载-显示如下类似报错" aria-label="Permalink to &quot;为什么部分插件无法加载，显示如下类似报错？&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Error: ENOENT: no such file or directory, open &#39;plugins\\nodejs\\sparkbridge2\\plugins\\xxxx\\spark.json&#39;</span></span></code></pre></div><p>因为你使用了 sb1 的插件。这与 sb2 不兼容。</p><h2 id="为什么我的-plugins-文件夹没有-nodejs-文件夹" tabindex="-1">为什么我的 plugins 文件夹没有 nodejs 文件夹？ <a class="header-anchor" href="#为什么我的-plugins-文件夹没有-nodejs-文件夹" aria-label="Permalink to &quot;为什么我的 plugins 文件夹没有 nodejs 文件夹？&quot;">​</a></h2><p>LeviLaminav取消了nodejs文件夹，直接将插件放入plughins文件夹即可加载</p><p>如果您仍在使用Liteloader，请确保版本需要大于 2.5.0。</p><h2 id="可以连接多个服务器吗" tabindex="-1">可以连接多个服务器吗？ <a class="header-anchor" href="#可以连接多个服务器吗" aria-label="Permalink to &quot;可以连接多个服务器吗？&quot;">​</a></h2><p>多个服务器同时安装 sparkbridge 然后 Onebot 实现中连接多个后端可实现一个 bot 控制多个服务器。</p><p><strong>需要注意的是一个 sparkbridge 插件只能用于一个服务器。</strong></p><h2 id="教程看不懂怎么办" tabindex="-1">教程看不懂怎么办？ <a class="header-anchor" href="#教程看不懂怎么办" aria-label="Permalink to &quot;教程看不懂怎么办？&quot;">​</a></h2><p><img src="'+n+'" alt=""></p>',18),i=[s];function p(l,d,c,h,u,b){return o(),e("div",null,i)}const g=a(r,[["render",p]]);export{_ as __pageData,g as default};
